import Topbar from "./components/topbar/Topbar";
import Intro from "./components/topbar/Intro";
import Portfolio from "./components/topbar/Portfolio";
import Works from "./components/topbar/Works";
import Testimonial from "./components/topbar/Testimonial";
import Contact from "./components/intr/Contact";


function App() {
  return (
    <div className="app">
      <Topbar />
      <div className="sections">
        <Intro />
        <Portfolio />
        <Works />
        <Testimonial />
        <Contact />
      </div>
    </div>
  );
}

export default App;
